function formatFloat2(n){return(Math.round(n*100)/100).toString(10)}function perc(n,t){return n/100*t}function navigateTo(n){if(window.navigate)window.navigate(n);else if(location&&location.assign)location.assign(n);else{var t=location.pathname.lastIndexOf("/");location.pathname=t==-1?n:location.pathname.substr(0,t+1)+n}}function backTo(){history.go(-1)}function getClientLeft(n){var t=0,i;do i=n.tagName.toLowerCase(),t+=n.offsetLeft,typeof n.clientLeft!="undefined"&&i!="table"&&i!="body"&&(t+=n.clientLeft);while((n=n.offsetParent)!=null);return t}function getClientTop(n){var t=0,i;do i=n.tagName.toLowerCase(),t+=n.offsetTop,typeof n.clientTop!="undefined"&&i!="table"&&i!="body"&&(t+=n.clientTop);while((n=n.offsetParent)!=null);return t}function findPosX(n){var t=0;if(n.offsetParent)while(n.offsetParent)t+=n.offsetLeft,n=n.offsetParent;else n.x&&(t+=n.x);return t}function findPosY(n){var t=0;if(n.offsetParent)while(n.offsetParent)t+=n.offsetTop,n=n.offsetParent;else n.y&&(t+=n.y);return t}function replaceVals(n,t){for(var r=n,i=0;i<t.length;i+=2)r=r.replace(t[i],t[i+1]);return r}function getChildElementById(n,t,i){for(var u,f=null,e=n.getElementsByTagName(t),r=0;r<e.length;++r)if(u=e[r],u.getAttribute("id",0)==i){f=u;break}return f}function hookEventZero(n,t,i){n[t]=i}function updateHidden(n,t){var i=document.getElementsByName(n)[0];i.value=t.toString()}function getHiddenStr(n){var t=document.getElementsByName(n)[0];return t.value}function getHiddenNum(n){var t=document.getElementsByName(n)[0];return parseFloat(t.value)}function getHiddenInt(n){var t=document.getElementsByName(n)[0];return parseInt(t.value,10)}function safeGet(n){return n==0?1:n}function pointInRect(n,t,i){return t>=0&&t<n.clientWidth&&i>=0&&i<n.clientHeight}